style.css:
@-moz-document domain(knexjs.org) {
body {
  background: #333;
  color: #ccc;
}

a, a:visited {
  color: #ccc;
}

a:active, a:hover {
  color: #fff;
}

div#sidebar {
  background: #2c2c2c;
  border-right: 1px solid #444;
  box-shadow: 0 0 20px #444;
  -webkit-box-shadow: 0 0 20px #555;
  -moz-box-shadow: 0 0 20px #555;
}

a.toc_title, a.toc_title:visited {
  color: #eee;
}

.toc_section li a {
  color: #ccc;
}

pre {
  border-left: 5px solid #444;
}



